import React, { useEffect, useState } from "react";
import { getRunnerByEmail } from "../services/api";
import Header from "../styles/Header.js";
import Footer from "../styles/Footer.js";
import "../styles/Home.css";

const Home = () => {
  const [runners, setRunners] = useState([]);
  const [selectedRunner, setSelectedRunner] = useState(null);
  const [weeks, setWeeks] = useState([]);
  const [error, setError] = useState("");
  const [email, setEmail] = useState("");
  const [countdown, setCountdown] = useState("");
  const [selectedWeek, setSelectedWeek] = useState(null);

  useEffect(() => {
    const currentDate = new Date();
    const marathonDate = new Date("2025-06-22T06:00:00");
    const remainingTime = marathonDate - currentDate;

    if (remainingTime > 0) {
      const days = Math.ceil(remainingTime / (1000 * 60 * 60 * 24));
      const hours = Math.floor((remainingTime / (1000 * 60 * 60)) % 24);
      setCountdown(`${days} dias e ${hours} horas restantes`);
    } else {
      setCountdown("A maratona já passou!");
    }

    // Inicializar estrutura de 24 semanas
    const totalWeeks = 24;
    const weekData = Array.from({ length: totalWeeks }, (_, i) => ({
      week: i + 1,
      hasWorkout: false,
      workout: null, // Armazena detalhes do treino
    }));
    setWeeks(weekData);
  }, []);

  const handleSearch = () => {
    if (!email) return setError("Por favor, insira um e-mail.");
    setError("");

    getRunnerByEmail(email)
      .then((response) => {
        setSelectedRunner(response.data);

        // Atualizar estrutura das semanas com base nos treinos do usuário
        setWeeks((prevWeeks) =>
          prevWeeks.map((week) => {
            const workout = response.data.runningWorkouts.find(
              (workout) => workout.week === week.week
            );
            return {
              ...week,
              hasWorkout: !!workout,
              workout: workout || null,
            };
          })
        );
      })
      .catch(() => setError("Usuário não encontrado."));
  };

  const handleWeekClick = (week) => {
    setSelectedWeek(week.workout ? week : null);
  };

  return (
    <div className="container">
      <Header />
      <main className="main-content">
        <h1 className="title">PERSONAL MARATHON</h1>
        {error && <p className="error">{error}</p>}

        {!selectedRunner && (
          <div className="countdown-container">
            <h2>Contagem Regressiva para a Maratona</h2>
            <p>{countdown}</p>
          </div>
        )}

        {!selectedRunner && (
          <div className="search-container">
            <h2>Buscar Treinos</h2>
            <input
              type="email"
              placeholder="Digite o e-mail do corredor"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              className="input-field"
            />
            <button onClick={handleSearch} className="button">
              Buscar
            </button>
          </div>
        )}

        {selectedRunner && (
          <div className="runner-details">
            <h3>Detalhes do Corredor</h3>
            <p>
              <strong>Nome:</strong> {selectedRunner.name || "Não informado"}
            </p>
            <p>
              <strong>Email:</strong> {selectedRunner.email}
            </p>
            <h4>Semanas de Treino:</h4>
            <div className="training-weeks">
              {weeks.map((week) => (
                <div
                  key={week.week}
                  className="workout-week-card"
                  onClick={() => handleWeekClick(week)}
                  style={{ cursor: week.hasWorkout ? "pointer" : "default" }}
                >
                  <div className="week-header">
                    Semana {week.week} -{" "}
                    {week.hasWorkout
                      ? "Treino cadastrado"
                      : "Nenhum treino cadastrado"}
                  </div>
                </div>
              ))}
            </div>
          </div>
        )}

        {/* Exibir detalhes do treino selecionado */}
        {selectedWeek && (
          <div className="workout-details">
            <h4>Detalhes do Treino da Semana {selectedWeek.week}</h4>
            <p>
              <strong>Descrição:</strong>{" "}
              {selectedWeek.workout?.description || "Sem descrição"}
            </p>
            <p>
              <strong>Distância:</strong>{" "}
              {selectedWeek.workout?.distance || "Não informada"} km
            </p>
            <p>
              <strong>Duração:</strong>{" "}
              {selectedWeek.workout?.duration || "Não informada"} min
            </p>
          </div>
        )}
      </main>
      <Footer />
    </div>
  );
};

export default Home;
